import React from 'react'

const Home = () => {

  var styles = {
    h1: {
      fontsize: "32px",
      textshadow: "-1px 1px #0c0, 1px 1px #060, -3px 0 4px #000",
      fontfamily: "Arial, Helvetica, sans - serif",
      color: "#090",
      padding: "16px",
      fontweight: "lighter",
      mozboxshadow: "2px 2px 6px #888",
      webkitboxshadow: "2px 2px 6px #888",
      boxshadow: "2px 2px 6px #888",
      textalign: "center",
      display: "block",
      margin: "16px",
      backgroundimage: "url(images / background - h1 - wood.jpg)"
  //margin: "auto",
  //width: "800px",
  //background: "yellow"
}
}

return (
  <h1 style={styles.h1}>Welcome to Real Estate Broker Application</h1>
);
}

export default Home
